import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter } from 'react-router-dom';
import Menu from './components/Menu/Menu';
import Footer from './components/Footer/Footer'
ReactDOM.render(
    <BrowserRouter><Menu /></BrowserRouter>, document.getElementsByClassName('menu')[0]
);
ReactDOM.render(
    <BrowserRouter><App /></BrowserRouter>, document.getElementsByClassName('main')[0]
);
ReactDOM.render(
    <BrowserRouter><Footer /></BrowserRouter>, document.getElementsByClassName('footer')[0]
);
